import React from 'react';
import './Page1.css'

// onChange={selectedName} on line 14 (nameBox)

//<div> <input  id= "strainBox" className="Page1" type="text" placeholder="Select Strain" /> </div>

export const Page1 = ({onClickNext, selectedName}) => { 
    const handleChangeName = event => {
        selectedName(event.target.value);
    };

    return (
        <div>
            <div id="mainText">PotExpress</div>
            <div> <button onClick={onClickNext} id="nextButton">Next</button> </div>

            <div> 
                <div id="name">Name</div>
                <div> <input  id= "nameBox" className="Page1" type="text" placeholder="Enter Name" onChange={selectedName}/> </div>
            </div>

            <div>
                <div id="address">Address</div>
                <div> <input  id= "addressBox" className="Page1" type="text" placeholder="Enter Address" /> </div>
            </div>

            <div>
                <div id="strain">Strain</div>

                <div> 
                    <select  id="strainBox">
                        <option value="indica">Indica</option>
                        <option value="sativa">Sativa</option>
                        <option value="hybrid">Hybrid</option>
                    </select>
                </div>
            </div>

        </div>
        );
  }
